import {NextPage} from 'next';
import React from 'react';

const SignUp: NextPage = () => {
  return (
    <>
      <h1>注册</h1>
      <form>
        <div>
          <label>
            用户名
            <input type="text"/>
          </label>
          <label>
            密码
            <input type="text"/>
          </label>
          <label>
            确认密码
            <input type="text"/>
          </label>
        </div>
      </form>
    </>

  );
};

export {SignUp};
